    <header className="header">
        <h1>
            Better Definitions
        </h1>
    </header>
)

const mainContent = (
    <main id={"main-content"}>
        <section id={"d-search"}>
            {definitionSearch}
        </section>
    </main>
)

const definitionSearch = <input id={"definition-search-input"} placeholder={"Search"}/>

